import React, { useState, useEffect } from 'react';
import API from '../services/api';

const AgentList = () => {
  const [agents, setAgents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchAgents();
  }, []);

  const fetchAgents = async () => {
    try {
      const res = await API.get('/api/agents');
      setAgents(res.data);
      setError('');
    } catch (err) {
      setError('Failed to fetch agents');
    }
    setLoading(false);
  };

  if (loading) return <div>Loading...</div>;

  return (
    <div style={{ padding: '20px' }}>
      <h2>Agents List</h2>
      {error && <div style={{ color: 'red', marginBottom: '10px' }}>{error}</div>}
      
      {agents.length === 0 ? (
        <p>No agents found</p>
      ) : (
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ backgroundColor: '#f8f9fa' }}>
              <th style={{ border: '1px solid #ddd', padding: '10px' }}>Name</th>
              <th style={{ border: '1px solid #ddd', padding: '10px' }}>Email</th>
              <th style={{ border: '1px solid #ddd', padding: '10px' }}>Mobile</th>
            </tr>
          </thead>
          <tbody>
            {agents.map(agent => (
              <tr key={agent._id}>
                <td style={{ border: '1px solid #ddd', padding: '10px' }}>{agent.name}</td>
                <td style={{ border: '1px solid #ddd', padding: '10px' }}>{agent.email}</td>
                <td style={{ border: '1px solid #ddd', padding: '10px' }}>{agent.mobile}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AgentList;
